Articles.Content:
Why in stock fuel tanks and in interstellar fuel tanks, values of baseResourceMassDivider is different , and how to make them equal? In old version of IFS, I could delete line:  

 @MODULE[InterstellarFuelSwitch]:NEEDS[RealSolarSystem]  

    {  

        %tankResourceMassDividerAddition = 12;12;12;13.333333333333;8.7272727273;12;12;12;12;12;12  

    }  

in IntegrationLiquidFuel.cfg and IntegrationLiquidFuelOxidizer.cfg, but in current version I`m not found this line in configs.
